typedef struct {
    int value;
    void (*next)(void);
} FibonacciState;

FibonacciState state = {0, NULL};
jmp_buf jump_buffer;
int results[FIBONACCI_COUNT];
int current_index = 0;

void calculate_next_fibonacci(void);

void calculate_next_fibonacci(void) {
    int temp = state.value;
    state.value = OBFUSCATE(OBFUSCATE(state.value) + OBFUSCATE(results[current_index - 2] ^ 0xDEADBEEF));
    results[current_index++] = OBFUSCATE(state.value) ^ 0xDEADBEEF;
    
    if (current_index < FIBONACCI_COUNT) {
        longjmp(jump_buffer, 1);
    }
}

void print_binary(int num) {
    char binary[33];
    binary[32] = '\0';
    
    for (int i = 31; i >= 0; i--) {
        binary[i] = (num & 1) ? '1' : '0';
        num >>= 1;
    }
    
    printf("%s\n", binary);
}

char* linked_list_to_string(Node* head) {
    int length = 0;
    Node* temp = head;
    while (temp != NULL) {
        length++;
        temp = temp->next;
    }
    
    char* str = (char*)malloc((length + 1) * sizeof(char));
    temp = head;
    int i = 0;
    while (temp != NULL) {
        str[i++] = temp->data;
        temp = temp->next;
    }
    str[i] = '\0';
    return str;
}

void free_list(Node* head) {
    Node* temp;
    while (head != NULL) {
        temp = head;
        head = head->next;
        free(temp);
    }
}
